import React from "react";

function CreateUser({ username, email, onChange, onCreate }) {
  const value = username + "kk";
  return (
    <div>
      <input
        name="username"
        placeholder="username"
        onChange={onChange}
        value={username}
      />
      <input
        name="email"
        placeholder="email"
        onChange={onChange}
        value={email}
      />
      <button onClick={onCreate}>Create Account</button>
    </div>
  );
}

export default CreateUser;
